"ko": |-
  두 응답을 모두 전달했을 수 있는 프록시에서(이는 비정상적인 상황에서 발생할 수 있습니다. 특히 프록시가 요청을 분기한 다음 충돌하는 경우 응답이 다른 프록시로 전달될 수 있으며 이로 인해 여러 응답이 업스트림으로 전달될 수 있습니다). 이전 ACK와 일치하는 INVITE 트랜잭션과 일치하는 ACK 요청은 이전 ACK의 재전송으로 간주됩니다.
